Verenigde Staten
Komedie / Romantiek
116 minuten

geregisseerd door Dennis Dugan
met Adam Sandler, Jennifer Aniston en Nicole Kidman

Dr. Patrick Maccabee, een plastisch chirurg, heeft bindingsangst en vertelt daarom zijn veel jongere vriendin Beverly (Brooklyn Decker) dat hij getrouwd is en kinderen heeft om te voorkomen dat de relatie te serieus wordt. Wanneer ze vermoedens krijgt dat hij liegt vraagt hij zijn kantoormanager Katherine Palmer (Jennifer Aniston) en haar kinderen om als zijn gezin op te treden om zijn eerlijkheid te bewijzen.


